import React, { useEffect, useState } from 'react';

const AnalyticsData = () => {
    const [analytics, setAnalytics] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchAnalytics = async () => {
            try {
                console.log('Fetching analytics data...');
                
                const response = await fetch('http://localhost:3000/api/analytics');
                console.log('Backend Response:', response);

                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }

                const data = await response.json();
                console.log('Fetched Data:', data); // Log the received data
                
                setAnalytics(data.data); // Assuming `data.data` holds the analytics object
            } catch (err) {
                console.error('Error while fetching data:', err);
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchAnalytics();
    }, []);

    // If still loading, show loading message
    if (loading) {
        console.log('Loading data...');
        return <p>Loading...</p>;
    }

    // If there was an error, show error message
    if (error) {
        console.error('An error occurred:', error);
        return <p>Error: {error}</p>;
    }

    // Log the final analytics data to verify it's being rendered
    console.log('Analytics Data:', analytics);

    return (
        <div>
            <h1>Analytics Data</h1>
            <ul>
                <li>Users: {analytics?.Users}</li>
                <li>Page Views: {analytics?.PageViews}</li>
                <li>Engagement Duration: {analytics?.EngagementDuration}</li>
            </ul>
        </div>
    );
};

export default AnalyticsData;
